import React from 'react';
import './App.css';
import Clock from './Clock';
import jsonData from './testinfo.json';

const App = () => {
  return (
    <div className="app">
      <h1>Test</h1>
      <Clock />
      <div className="question-container">
        <h1>Type: {jsonData.type}</h1>
        <h1>Question: {jsonData.question}</h1>
        <div className="options-container">
          {jsonData.options.map((option, index) => (
            <button key={index} className="option-box">{option}</button>
          ))}
        </div>
        <h1>Answer: {jsonData.answer}</h1>
      </div>
    </div>
  );
};

export default App;
